Display array of documents as objects with id as key<p>Is there a way to use <code>project</code> or <code>group</code> in mongo to convert an array of documents or subdocuments into an object with documents ObjectId as key and document/subdocument as value?</p>

<p>For example: </p>

<pre><code>const book = Schema({
    name: {type: String},
    authors: [{type: mongoose.Schema.Types.ObjectId, ref: 'Author'}]
})

const author = Schema({name: {type: String}})
</code></pre>

<p>If you query for all books:</p>

<p><code>Book.find({}).populate('authors').lean().exec()</code></p>

<p>then you get:</p>

<pre><code>[{
    id: 10,
    name: 'Book 1',
    authors: [{
        id: 1, 
        name: 'Author1'
    }]

},...]
</code></pre>

<p>but I would like to have this:</p>

<pre><code>[{
    id: 10,    
    name: 'Book 1',
    authors: {
        1: {id: 1, name: 'Author 1'}
    }
},...]
</code></pre>

<p>I know that iterating over the objects after querying from mongo will do it but I guess that running the query at mongo is more efficient. </p>

