MongoDB C# Driver: throw exception when querying on ignored property<p>I am using the MongoDB C# Driver v2.7.x, but I was wondering given a POCO class, is there anyway to raise warnings when querying on unmapped properties.</p>

<p>For example, I have the following class:</p>

<pre><code>public class GroceryList
{
    public string Name { get; set; }

    [BsonIgnore]
    public bool IsOwner { get; set; }
}
</code></pre>

<p>So whenever I store this object, <code>IsOwner</code> is not inserted into the database (<a href="http://mongodb.github.io/mongo-csharp-driver/2.7/reference/bson/mapping/#ignoring-a-member" rel="nofollow noreferrer">see also the ignore member docs</a>). However when I perform <code>GetCollection&lt;GroceryList&gt;(..).AsQueryable().Where(gl =&gt; gl.IsOwner)</code>, this gets translated into <code>{$match: {IsOwner: true}}</code>, thus the element is still used in the query (<a href="http://mongodb.github.io/mongo-csharp-driver/2.7/reference/driver/crud/linq/" rel="nofollow noreferrer">see also the MongoDB LINQ docs</a>).</p>

<p>Now in this trivial example it's easy to spot the problem; however when there's a few layers of indirection and a function starts returning an <code>IQueryable</code> instead of <code>IEnumerable</code>, it gets harder. So I would like to prevent the situation where ones could query on any field that's not mapped. Preferably through some convention (<code>IMemberMapConvention</code>).</p>

