Circular Reference Issue in Mongoose pre-hook<p>In my MongoDB/Node backend environment I am using Mongoose <code>pre</code> and <code>post</code> hook middleware to check what's changed on the document, in order to create some system notes as a result.</p>

<p>One problem I'm running into is that when I try and lookup the record for the document in question I get a <code>"Customer.findOne()" is not a function</code> error. This is ONLY a problem when I'm looking up a record from the same collection from which the model just launched this <code>pre</code> and <code>post</code> hook triggers file. In other words, if my "Customer" model kicks off functions in a pre hook function in an external file, then I get an error if I then try and lookup a <code>Customer</code> with a standard <code>findOne()</code>:</p>

<p>My customer model looks something like this:</p>

<pre><code>module.exports = mongoose.model(
  "Customer",
  mongoose
    .Schema(
      {
        __v: {
          type: Number,
          select: false
        },
        deleted: {
          type: Boolean,
          default: false
        },
        // Other props
        searchResults: [
          {
            matchKey: String,
            matchValue: String
          }
        ]
      },
      {
        timestamps: true
      }
    )
    .pre("save", function(next) {
      const doc = this;
      trigger.preSave(doc);
      next();
    })
    .post("save", function(doc) {
      trigger.postSave(doc);
    })
    .post("update", function(doc) {
      trigger.postSave(doc);
    })
    .post("findOneAndUpdate", function(doc) {
      trigger.postSave(doc);
    })
);
</code></pre>

<p>... the problematic <code>findOne()</code> function in the <code>triggers</code> file being called from the model looks like this:</p>

<pre><code>const Customer = require("../../models/customer");

exports.preSave = async function(doc) {
   this.preSaveDoc = await Customer.findOne({
     _id: doc._id
   }).exec();
};
</code></pre>

<p>To clarify, this is NOT a problem if I'm using a <code>findOne()</code> to lookup a record from a different collection in this same <code>triggers</code> file. Then it works fine. See below when finding a <code>Contact</code> -- no problem here:</p>

<pre><code>const Contact = require("../../models/contact");

exports.preSave = async function(doc) {
   this.preSaveDoc = await Contact.findOne({
     _id: doc._id
   }).exec();
};
</code></pre>

<p>The workaround I've found is to use Mongo instead of Mongoose, like so:</p>

<pre><code>exports.preSave = async function(doc) {
  let MongoClient = await require("../../config/database")();
  let db = MongoClient.connection.db;

  db.collection("customers")
    .findOne({ _id: doc._id })
    .then(doc =&gt; {
      this.preSaveDoc = doc;
    });
}
</code></pre>

<p>... but I'd prefer to use Mongoose syntax here. How can I use a <code>findOne()</code> in a pre-hook function being called from the same model/collection as the lookup type?</p>

