How to check if a document il linked to another in MongoDB<p>Suppose that I have two collections:</p>

<p><em>Users</em></p>

<pre><code>_id:5c810da8c714a02e84d16d16
username:foo
</code></pre>

<p><em>Tokens</em></p>

<pre><code>_id: 5c81347b00370c2848db8725
_userId: 5c810da8c714a02e84d16d16
token: "83790bf08fa16eec1c3c6761d0c1be4f"
</code></pre>

